INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (11, "わあ……素敵なケーキね！\nえ？　キミが作ったの？\nすごいじゃない！", "", 0, 4, 103411, 1034501, 0, 1, 1, 1034501040);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (91, "", "", "", "", 0, 1034501, "", "", "", 1034501041);
