INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (11, "誕生日を祝ってくれてありがとう。\nいくつになってもお祝いして\nもらえるのはうれしいものね。", "", 0, 7, 105111, 1051501, 0, 1, 1, 1051501040);
