INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (11, "ここまでしてもらったら大人しく\n祝ってもらうしかないわね。\nいくら私でも時と場合は\nちゃんとわきまえるわよ。", "", 0, 6, 105111, 1051501, 0, 1, 1, 1051501046);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (91, "", "", "", "", 0, 1051501, "", "", "", 1051501047);
