INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (11, "君には健康でいてもらって\nまた誕生日を祝ってもらいたいもの。\nまあ、薬が効きすぎて\n変なことになってもご愛敬ね。", "", 0, 6, 105111, 1051501, 0, 1, 1, 1051501052);
