INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (11, "おめでとうって言ってもらえるだけでも\nうれしいのに、手作りのケーキまで……\n私、あなたにいろんなものを\nもらってばっかりね。", "", 0, 6, 105211, 1052501, 0, 1, 1, 1052501043);
